set charset utf8;
DROP TABLE IF EXISTS `news`;
CREATE TABLE `news` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `cate_id` int(10) unsigned NOT NULL,
  `title` varchar(90) NOT NULL,
  `image` text NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `views` mediumint(8) unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1907 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `news_cate`;
CREATE TABLE `news_cate` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` int(10) unsigned NOT NULL,
  `level` tinyint(1) unsigned NOT NULL,
  `cate_name` varchar(60) NOT NULL,
  `image` text NOT NULL,
  `display` tinyint(1) unsigned NOT NULL,
  `children` mediumint(8) unsigned NOT NULL,
  `dateline` float unsigned NOT NULL,
  `status` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=77 DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `news_data`;
CREATE TABLE `news_data` (
  `news_id` int(10) unsigned NOT NULL,
  `content` mediumtext NOT NULL,
  PRIMARY KEY (`news_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;
DROP TABLE IF EXISTS `order`;
CREATE TABLE `order` (
  `id` varchar(60) NOT NULL,
  `type` tinyint(1) unsigned NOT NULL COMMENT '订单类型（0:服务订单;1:实物订单;）',
  `from` tinyint(1) unsigned NOT NULL COMMENT '订单来源（ 预留）',
  `subject` varchar(90) NOT NULL,
  `body` varchar(255) NOT NULL,
  `buyer_id` int(10) NOT NULL,
  `pick` tinyint(1) unsigned NOT NULL COMMENT '取货类型（0:快递;1:自提）',
  `consignee` varchar(255) NOT NULL,
  `province_id` mediumint(8) unsigned NOT NULL,
  `city_id` mediumint(8) unsigned NOT NULL,
  `county_id` mediumint(8) unsigned NOT NULL,
  `address` text NOT NULL,
  `zip` varchar(30) NOT NULL,
  `telephone` varchar(255) NOT NULL,
  `mobile` varchar(255) NOT NULL,
  `item_amount` decimal(20,2) unsigned NOT NULL COMMENT '商品总额',
  `shipping` decimal(20,2) unsigned NOT NULL,
  `amount` decimal(20,2) unsigned NOT NULL COMMENT '订单总额',
  `discount` decimal(20,2) unsigned NOT NULL COMMENT '是否有优惠活动',
  `pay_amount` decimal(20,2) unsigned NOT NULL COMMENT '实际支付',
  `refund_amount` decimal(20,2) unsigned NOT NULL COMMENT '退款金额',
  `turnover` decimal(20,2) unsigned NOT NULL,
  `payment` varchar(30) NOT NULL,
  `out_id` varchar(60) NOT NULL,
  `out_account` varchar(255) NOT NULL,
  `tax` tinyint(1) unsigned NOT NULL COMMENT '是否要发票',
  `tax_title` varchar(90) NOT NULL COMMENT '发票抬头',
  `tax_content` varchar(255) NOT NULL COMMENT '发票内容',
  `memo` varchar(255) NOT NULL,
  `refund_reason` varchar(255) NOT NULL,
  `refuse_reason` varchar(255) NOT NULL,
  `feedback` tinyint(1) unsigned NOT NULL,
  `display` tinyint(1) unsigned NOT NULL,
  `clock` int(10) unsigned NOT NULL,
  `dateline` int(10) unsigned NOT NULL,
  `pay_time` int(10) unsigned NOT NULL,
  `finish_time` int(10) unsigned NOT NULL,
  `status` tinyint(2) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `buyer_id` (`buyer_id`)
) ENGINE=MyISAM AUTO_INCREMENT=213654 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC;
